import './App.css';

function App() {
  let joinRoom = async() =>{
    fetch('http://127.0.0.1:8000/api/join',{
      method: "PUT",
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify("bruh")
    })
  }


  return (
    <div className="App">
      <button onClick={joinRoom}>test</button>
    </div>
  );
}

export default App;
